import React from 'react';
import './Main.css'

//components
import Section from './Section/Section';
import Blurb from './Blurbs/Blurb';

//content
import AboutMe from './Blurbs/Content/AboutMe/AboutMe'
import Skills from './Blurbs/Content/Skills/Skills'
import Projects from './Blurbs/Content/Projects/Projects'


const Main = () => {
    return (
    <div className="container">

        <Section
        id='aboutme'>
            <Blurb title={'About Me'}>
                <AboutMe/>
            </Blurb>
        </Section>
        
        <Section
        id='skills'>
        <Blurb title={'Skills'}></Blurb>
        </Section>

        <Section
        id='projects'>
        <Blurb title={'Projects'}/>
        </Section>

    </div>
    );
}

export default Main;
